/* Reconstructs the full frame from Gradient + Sprite */
static inline void generate_status_frame(
    unsigned char *dest,
    const unsigned char *gradient_lut,
    const struct overlay_sprite *sprite)
{
    unsigned int row, col;
    unsigned char *p = dest;

    /* 1. Fill Background (Gradient Y, Gray U/V) */
    for (row = 0; row < STATUS_IMAGE_HEIGHT; row++) {
        unsigned char y_val = gradient_lut[row];
        for (col = 0; col < STATUS_IMAGE_WIDTH; col += 2) {
            *p++ = y_val;   /* Y0 */
            *p++ = 0x80;    /* U  (Neutral Gray) */
            *p++ = y_val;   /* Y1 */
            *p++ = 0x80;    /* V  (Neutral Gray) */
        }
    }

    /* 2. Draw Sprite (Full Color YUYV) */
    if (sprite && sprite->data) {
        const unsigned char *src = sprite->data;
        for (row = 0; row < sprite->h; row++) {
            /* Calculate pointer to start of this row in dest */
            unsigned char *dst_row = dest + ((sprite->y + row) * STATUS_IMAGE_WIDTH * 2) + (sprite->x * 2);

            /* Copy row bytes */
            for (col = 0; col < sprite->w * 2; col++) {
               *dst_row++ = *src++;
            }
        }
    }
}
